<div class="container">
    <h3 mat-dialog-title>Do you want to continue store check in object {{ data }}?</h3>
    <form class="mat-dialog-content" #formControl="ngForm">
        <div mat-dialog-actions class="wrap">

            <button mat-button class="test" (click)="close()">No</button>
            <button mat-button class="test" (click)="changeRetval()">Yes</button>
            
        </div>
    </form>
</div>
